import logo from "./img/S_logo.png";
import { Squash as Hamburger } from "hamburger-react";
import "./img/Acme-Regular.ttf";

const Topbar = () => {
  return (
    <div
      id="Topbar"
      className="flex justify-between p-2 border-b-2 border-black bg-my-yellow"
    >
      <div id="title" className="flex items-center justify-center">
        <div id="title-logo" className="w-12 b">
          <img src={logo} alt="logo" srcset="" />
        </div>
        <div id="title-name">
          <p style={{ "font-family": "Acme" }} className="text-4xl">
            Mate.ly
          </p>
        </div>
      </div>
      <div id="menu-button">
        <Hamburger rounded size={30} />
      </div>
    </div>
  );
};
export default Topbar;
